import React from 'react';
import { Link } from 'react-router-dom';
import { Button, Form, Message } from 'semantic-ui-react'

export default function MobileNavBar({ handleLogOut, user, onClick }) {
    console.log(user)
    return (
        <>
            <Button.Group className='mobile-nav-buttons'>
                <Button to="/profile"><Link to="/profile">Profile</Link></Button>
                <Button to="/search"><Link to="/search" >Search</Link></Button>
                <Button to="/"><Link to="/" onClick={handleLogOut}>Logout</Link></Button>
            </Button.Group>

        </>
    )
}
